<!DOCTYPE html>
<html lang="en">
<head>
    <title>Express FD Token Entry</title>
    <link href="https://fonts.googleapis.com/css?family=Lato:400,400i,700,700i&amp;display=swap" rel="stylesheet">
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1 user-scalable=no"/>
    <style>
        body,
        html,
        p {
            margin: 0;
            padding: 0;
            font-family: 'Lato', sans-serif;
            text-decoration: none;
        }

        body {
            background-color: #f8f8f8;
            height: 100%
        }

        .card {
            background-color: #fff;
            border-radius: 20px;
            box-shadow: 0 0 32px 0 rgba(0,0,0,.15);
            margin: 45% 20px;
        }

        .text-field {
            border: 0;
            border-bottom: 1px solid #6d6e71;
            color: #231f20;
            font-size: 14px;
            height: 35px;
            width: 100%;
        }

        .submit-button {
            background-color: #97214d;
            border: none;
            border-radius: 4px;    
            color: #ffffff;
            font-family: 'lato';
            font-size: 13px;
            height: 45px;
            overflow: hidden;
            position: relative;
            text-transform: uppercase;
            width: 100%;
        }

        .redirect-section, .branding-section {
            padding: 20px;
            text-align: center;
        }

        .branding-content {
            display: inline-block;
        }

        .branding-content span {
            color: #979797;
            display: inline-block;
            font-size: 10px;
            margin-right: 5px;
            margin-top: 8px;
            vertical-align: top;
        }

        .branding-content img {
            height: 24px;
            width: 90px;
        }
    </style>
</head>
<body>
    <div class="card">
        <div class="redirect-section">
            <h4>Enter your token here</h4>
            <form action='https://enachuat.npci.org.in:8086/onmags_new/sendRequest' method="POST">
                MandateReqDoc<input type="text" id="MandateReqDoc" name="MandateReqDoc" class="text-field"><br><br>
                MerchantID <input type="text" id="MerchantID" name="MerchantID" class="text-field"><br><br>
                CheckSumVal<input type="text" id="CheckSumVal" name="CheckSumVal" class="text-field"><br><br>
                BankID<input type="text" id="BankID" name="BankID" class="text-field"><br><br>
                SPID<input type="text" id="SPID" name="SPID" class="text-field"><br><br>
                AuthMode<input type="text" id="AuthMode" name="AuthMode" class="text-field"><br><br>
                <input type="submit" value="Submit" class="submit-button">
            </form>
        </div>
